import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';



export default ({ id, name, amount }) =>  {

    let icon;

    switch (name) {
        case 'Savings':
            icon = "fas fa-piggy-bank";
            break;
        case 'Account':
            icon = "fas fa-money-check-alt";
            break;
        case 'Online CC':
            icon = "fas fa-credit-card aqua";
            break;
        case 'Jobad CC':
            icon = "fas fa-credit-card";
            break;
        case 'Maddie CC':
            icon = "fas fa-credit-card pink";
            break;
        case 'Respaldo CC':
                icon = "fas fa-credit-card respaldo";
                break;
        case 'Amazon CC':
            icon = "fab fa-cc-amazon-pay";
            break;
        case 'Cash':
            icon = "fas fa-money-bill";
            break;
        case 'Paypal CC':
            icon = "fab fa-paypal";
            break;
        case 'Stock':
            icon = "fas fa-chart-line";
            break;
    }


    return (

        <li className="regular">
            <i className={`fas ${icon}`}></i>
            <div className="name">{name}</div>
            <div className="amount">${amount}</div>
        </li>

    );

}
